import{log}from"./05_Modules_Class.js";log("Load Modules.");class Car{constructor(e,t,r,s){this.modelName=e,this.modelYear=t,this.type=r,this.price=s}getModelName(){return this.modelName}getModelYear(){return this.modelYear}getType(){return this.type}getPrice(){return this.price}setModelName(e){this.modelName=e}setModelYear(e){this.modelYear=e}setType(e){this.type=e}setPrice(e){this.price=e}}let sonata=new Car("소나타","2019","c",3e3),genesis=new Car("제네시스","2021","g",7e3);sonata.setPrice(3300),console.log(sonata.getPrice());class ElectronicCar extends Car{constructor(e,t,r,s){super(e,t,"e",r),this.chargeTime=s}getChargeTime(){return this.chargeTime}setChargeTime(e){this.chargeTime=e}}let ionic=new ElectronicCar("아이오닉","2022",3500,5);console.log(ionic.getChargeTime());